  `pso_real_price` float DEFAULT NULL COMMENT '付款金额',
  PRIMARY KEY (`pso_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='订单表';
